DROP TABLE IF EXISTS bpkh_accounts;

CREATE TABLE `bpkh_accounts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `role` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'defined for each module separately',
  `username` varchar(25) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `password` varchar(64) CHARACTER SET latin1 NOT NULL,
  `salt` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `token_expires_at` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `language_code` varchar(2) CHARACTER SET latin1 NOT NULL DEFAULT 'en',
  `avatar` varchar(125) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `created_at` datetime DEFAULT NULL,
  `created_ip` varchar(15) CHARACTER SET latin1 NOT NULL,
  `last_visited_at` datetime DEFAULT NULL,
  `last_visited_ip` varchar(15) CHARACTER SET latin1 NOT NULL DEFAULT '000.000.000.000',
  `password_changed_at` datetime DEFAULT NULL,
  `notifications` tinyint(1) NOT NULL DEFAULT '0',
  `notifications_changed_at` datetime DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 - registration pending, 1 - active account',
  `is_removed` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'for logical removal',
  `comments` text COLLATE utf8_unicode_ci NOT NULL,
  `registration_code` varchar(20) CHARACTER SET latin1 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_admins;

CREATE TABLE `bpkh_admins` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(25) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `password` varchar(64) CHARACTER SET latin1 NOT NULL,
  `salt` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `token_expires_at` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `display_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `first_name` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `last_name` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(100) CHARACTER SET latin1 NOT NULL,
  `birth_date` date DEFAULT NULL,
  `language_code` varchar(2) CHARACTER SET latin1 NOT NULL DEFAULT '',
  `avatar` varchar(125) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `personal_info` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `role` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'admin' COMMENT '''owner'',''mainadmin'',''admin'' or other',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `password_changed_at` datetime DEFAULT NULL,
  `last_visited_at` datetime DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_backend_menu_translations;

CREATE TABLE `bpkh_backend_menu_translations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `menu_id` int(11) unsigned NOT NULL DEFAULT '0',
  `language_code` varchar(2) CHARACTER SET latin1 NOT NULL,
  `name` varchar(125) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_backend_menus;

CREATE TABLE `bpkh_backend_menus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(10) unsigned NOT NULL DEFAULT '0',
  `url` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `module_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `icon` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `is_system` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_visible` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `sort_order` smallint(6) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_ban_lists;

CREATE TABLE `bpkh_ban_lists` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `item_type` enum('ip_address','email_address','email_domain','username') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'ip_address',
  `item_value` varchar(100) CHARACTER SET latin1 NOT NULL,
  `reason` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `activity_counter` int(10) NOT NULL DEFAULT '0',
  `last_activity_at` datetime DEFAULT NULL,
  `started_at` date DEFAULT NULL,
  `expires_at` date DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `ban_item_type` (`item_type`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_countries;

CREATE TABLE `bpkh_countries` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `code` varchar(2) CHARACTER SET latin1 NOT NULL,
  `is_active` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `is_default` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `sort_order` smallint(6) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=237 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_country_translations;

CREATE TABLE `bpkh_country_translations` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `country_code` varchar(2) CHARACTER SET latin1 NOT NULL,
  `language_code` varchar(2) CHARACTER SET latin1 NOT NULL DEFAULT 'en',
  `name` varchar(70) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `country_code` (`country_code`),
  KEY `language_code` (`language_code`)
) ENGINE=MyISAM AUTO_INCREMENT=237 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_currencies;

CREATE TABLE `bpkh_currencies` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `symbol` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `code` varchar(3) CHARACTER SET latin1 NOT NULL,
  `rate` double(10,4) NOT NULL DEFAULT '1.0000',
  `decimals` tinyint(1) NOT NULL DEFAULT '2',
  `symbol_place` enum('before','after') CHARACTER SET latin1 NOT NULL DEFAULT 'before',
  `sort_order` tinyint(1) NOT NULL DEFAULT '0',
  `is_default` tinyint(1) NOT NULL DEFAULT '0',
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_email_template_translations;

CREATE TABLE `bpkh_email_template_translations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `template_code` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `language_code` varchar(2) CHARACTER SET latin1 NOT NULL DEFAULT 'en',
  `template_name` varchar(125) COLLATE utf8_unicode_ci NOT NULL,
  `template_subject` varchar(125) COLLATE utf8_unicode_ci NOT NULL,
  `template_content` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

