DROP TABLE IF EXISTS bpkh_email_templates;

CREATE TABLE `bpkh_email_templates` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `module_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `is_system` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_frontend_menu_translations;

CREATE TABLE `bpkh_frontend_menu_translations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `menu_id` int(11) DEFAULT '0',
  `language_code` varchar(2) CHARACTER SET latin1 NOT NULL DEFAULT 'en',
  `name` varchar(125) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `language_code` (`language_code`),
  KEY `menu_id` (`menu_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_frontend_menus;

CREATE TABLE `bpkh_frontend_menus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT '0',
  `menu_type` enum('pagelink','modulelink','moduleblock') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'pagelink',
  `module_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `link_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `link_target` enum('','_self','_blank') CHARACTER SET latin1 NOT NULL,
  `placement` enum('','left','top','right','bottom','hidden') CHARACTER SET latin1 NOT NULL,
  `sort_order` smallint(6) DEFAULT '0',
  `access_level` enum('public','registered') CHARACTER SET latin1 NOT NULL DEFAULT 'public',
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `placement` (`placement`),
  KEY `access_level` (`access_level`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_languages;

CREATE TABLE `bpkh_languages` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `name_native` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `code` varchar(2) COLLATE utf8_unicode_ci NOT NULL,
  `lc_time_name` varchar(5) CHARACTER SET latin1 NOT NULL DEFAULT 'en_US',
  `direction` varchar(3) CHARACTER SET latin1 NOT NULL DEFAULT 'ltr',
  `icon` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `used_on` enum('front-end','back-end','global') CHARACTER SET latin1 NOT NULL DEFAULT 'global',
  `is_default` tinyint(1) NOT NULL DEFAULT '0',
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_mailing_log;

CREATE TABLE `bpkh_mailing_log` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `email_from` varchar(40) COLLATE utf8_unicode_ci NOT NULL,
  `email_to` varchar(40) COLLATE utf8_unicode_ci NOT NULL,
  `email_subject` varchar(125) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `email_content` text COLLATE utf8_unicode_ci NOT NULL,
  `sent_at` datetime DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0 - error, 1- successfully sent',
  `status_description` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_module_settings;

CREATE TABLE `bpkh_module_settings` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `module_code` varchar(20) CHARACTER SET latin1 NOT NULL,
  `property_key` varchar(40) CHARACTER SET latin1 NOT NULL,
  `property_value` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `property_group` varchar(30) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `property_type` enum('string','email','phone','numeric','float','positive float','unsigned float','integer','positive integer','unsigned integer','enum','range','bool','html size','text','code','label') CHARACTER SET latin1 NOT NULL,
  `property_source` varchar(255) CHARACTER SET latin1 NOT NULL COMMENT 'for ''enum'' and ''range'' property types',
  `property_length` varchar(3) CHARACTER SET latin1 NOT NULL DEFAULT '' COMMENT 'for ''string'' and ''text'' property types',
  `append_text` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'append text to module propery on module settings page',
  `trigger_condition` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'includes serialized trigger condition and action fields',
  `is_required` tinyint(1) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code_key_value` (`module_code`,`property_key`,`property_value`),
  KEY `module_code` (`module_code`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_modules;

CREATE TABLE `bpkh_modules` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `code` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `class_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `name` varchar(40) CHARACTER SET latin1 NOT NULL,
  `description` varchar(255) CHARACTER SET latin1 NOT NULL,
  `version` varchar(5) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `icon` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `show_on_dashboard` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `show_in_menu` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_installed` tinyint(1) NOT NULL DEFAULT '0',
  `is_system` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_active` tinyint(1) NOT NULL DEFAULT '0',
  `installed_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `has_test_data` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0 - no, 1 - yes',
  `sort_order` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_payment_providers;

CREATE TABLE `bpkh_payment_providers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(40) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `description` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'for internal use',
  `instructions` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'for external use',
  `required_fields` varchar(40) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `merchant_id` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `merchant_code` varchar(60) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `merchant_key` varchar(60) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `used_on` enum('front-end','back-end','global') CHARACTER SET latin1 NOT NULL DEFAULT 'global',
  `mode` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 - test mode, 1- real mode',
  `sort_order` smallint(6) unsigned NOT NULL DEFAULT '1',
  `is_default` tinyint(1) NOT NULL DEFAULT '0',
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_privileges;

CREATE TABLE `bpkh_privileges` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `module_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `category` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `code` varchar(30) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=MyISAM AUTO_INCREMENT=47 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_role_privileges;

CREATE TABLE `bpkh_role_privileges` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `role_id` int(5) NOT NULL DEFAULT '0',
  `privilege_id` int(5) NOT NULL DEFAULT '0',
  `is_active` tinyint(1) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=139 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_roles;

CREATE TABLE `bpkh_roles` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `code` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `is_system` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

