DROP TABLE IF EXISTS bpkh_rss_channels;

CREATE TABLE `bpkh_rss_channels` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mode_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `channel_code` varchar(125) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `channel_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `channel_description` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `last_items` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `items_count` tinyint(1) NOT NULL DEFAULT '10',
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_search_categories;

CREATE TABLE `bpkh_search_categories` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `module_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `category_code` varchar(40) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `category_name` varchar(60) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `callback_class` varchar(80) CHARACTER SET latin1 NOT NULL DEFAULT '',
  `callback_method` varchar(125) CHARACTER SET latin1 NOT NULL DEFAULT '',
  `items_count` tinyint(1) NOT NULL DEFAULT '20',
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `category_code` (`category_code`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_search_words;

CREATE TABLE `bpkh_search_words` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `word_text` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `word_count` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `word_text` (`word_text`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_sessions;

CREATE TABLE `bpkh_sessions` (
  `session_id` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `expires_at` int(11) NOT NULL,
  `session_data` text COLLATE utf8_unicode_ci NOT NULL,
  UNIQUE KEY `session_id` (`session_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_settings;

CREATE TABLE `bpkh_settings` (
  `id` smallint(6) NOT NULL,
  `template` varchar(32) CHARACTER SET latin1 NOT NULL,
  `ssl_mode` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0 - no, 1 - entire site, 2 - admin area, 3 - user area, 4 - payment modules',
  `date_format` varchar(10) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'Y-m-d',
  `time_format` varchar(5) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'H:i:s',
  `datetime_format` varchar(16) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'Y-m-d H:i:s',
  `time_zone` varchar(32) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `daylight_saving` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `week_startday` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `number_format` enum('european','american') CHARACTER SET latin1 NOT NULL,
  `general_email` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `general_email_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `mailer` varchar(20) CHARACTER SET latin1 NOT NULL DEFAULT 'phpMail',
  `smtp_auth` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `smtp_secure` enum('ssl','tls','') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'ssl',
  `smtp_host` varchar(70) COLLATE utf8_unicode_ci NOT NULL,
  `smtp_port` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `smtp_username` varchar(40) COLLATE utf8_unicode_ci NOT NULL,
  `smtp_password` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `mailing_log` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `rss_feed` tinyint(1) NOT NULL DEFAULT '1',
  `rss_feed_type` enum('rss1','rss2','atom') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'rss1',
  `rss_items_per_feed` tinyint(3) unsigned NOT NULL DEFAULT '10',
  `search_items_per_page` tinyint(3) unsigned NOT NULL DEFAULT '20',
  `search_is_highlighted` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `is_offline` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `offline_message` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `analytics_level` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0 - entire site, 1 - public areas only, 2 - protected areas only',
  `analytics_code` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `dashboard_hotkeys` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `dashboard_notifications` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `dashboard_statistics` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `mapping_api_type` enum('google_maps') CHARACTER SET latin1 NOT NULL DEFAULT 'google_maps',
  `mapping_api_key` varchar(125) COLLATE utf8_unicode_ci NOT NULL,
  `website_domain` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `google_rank` varchar(2) CHARACTER SET latin1 NOT NULL,
  `alexa_rank` varchar(12) CHARACTER SET latin1 NOT NULL,
  `indexed_pages_google` varchar(10) CHARACTER SET latin1 NOT NULL,
  `indexed_pages_bing` varchar(10) CHARACTER SET latin1 NOT NULL,
  `indexed_pages_yahoo` varchar(10) CHARACTER SET latin1 NOT NULL,
  `indexed_pages_yandex` varchar(10) CHARACTER SET latin1 NOT NULL,
  `indexed_pages_baidu` varchar(10) CHARACTER SET latin1 NOT NULL,
  `indexed_pages_goo` varchar(10) CHARACTER SET latin1 NOT NULL,
  `site_last_updated` datetime DEFAULT NULL,
  `cron_type` enum('batch','non-batch','stop') CHARACTER SET latin1 NOT NULL DEFAULT 'stop',
  `cron_run_last_time` datetime DEFAULT NULL,
  `cron_run_period` enum('minute','hour') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'hour',
  `cron_run_period_value` smallint(6) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS bpkh_site_info;

CREATE TABLE `bpkh_site_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `language_code` varchar(2) CHARACTER SET latin1 NOT NULL,
  `logo` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `site_phone` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `site_fax` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `site_email` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
